import {apiClient} from './ApiClient'

export const retriveAllPatient = ()=> apiClient.get('/admin/patients')
export const retrivePatientById = ()=> apiClient.get(`/admin/patients/${id}`)
export const retriveAllArchivePatient = ()=> apiClient.get('/admin/archive/patients')
export const retriveArchivePatientByI = ()=> apiClient.get(`/admin/archive/patients/${id}`)
